import React from 'react';
import backgroundImage from "/home/cosbi/financialSite/frontend/src/image/coins_on_chart.jpg";

function HomeComp() {

    return (
        <div className = 'container'>
            <div className = 'jumbotron jumbotron-fluid' style = {{ backgroundImage : `url(${backgroundImage})` }}>
            </div>
        </div>
    );
}

export default HomeComp;
